    - ID: "c3afee16-1dbc-4a49-8037-9d03d0d7d62e"
      Hint: description
      Value: |
        <p>Our unit features a Cat&reg; C4.4 (Tier 4 or Tier III export) diesel engine with an optional spark arrestor. Large service doors provide easy access to the fuel tank, engine, compressor, air filters, and tool storage compartment. Rear service panels provide access to the side-by-side compressor fluid cooler, engine air cooler, and engine radiator. Capacity control is zero to 100% with the pneumatic inlet valve and unloaded starting.</p>
        <p>The unit incorporates a shutdown system and annunciation module for high compressor temperature, high engine coolant temperature, low engine oil pressure, engine underspeed, and low fuel shutdown. The unit will produce 375 ft&sup3;/min at a rated pressure of 100 psig and has a pressure range of 80 to 125 psig. The unit weighs 4,980 lb.</p>
